import React from 'react';
import Categories from './Categories';

export default function CategoryOverview(props) {
    const { types } = props;
    return (
        <div className="categflex">
            {types.map((type) => (
                <Categories key={type.id} type={type} />
            ))}
        </div>
    )
}
